function getReadableDuration(e){var t="";var n=Math.floor(e/1e3/60/60);e-=n*1e3*60*60;var r=Math.floor(e/1e3/60);e-=r*1e3*60;var i=Math.floor(e/1e3);var s=e%1e3;if(n>0){t+=n;t+=n==1?" hour ":" hours "}if(r>0){t+=r;t+=r==1?" minute ":" minutes "}if(i>0){t+=i;t+=i==1?" second ":" seconds "}if(s>0){t+=s;t+=s==1?" millisecond ":" milliseconds "}return t}function isValidPoint(e,t){if(e.x<0||e.x>=gridSize||e.y<0||e.y>=gridSize){return false}return _.filter(t,_.matches({x:e.x,y:e.y})).length==0}function move(e,t){if(isValidPoint(e,t)){if(e.x==gridSize-1&&e.y==gridSize-1){numPaths++}else{t.push(e);move(new Point(e.x-1,e.y),_.clone(t));move(new Point(e.x+1,e.y),_.clone(t));move(new Point(e.x,e.y-1),_.clone(t));move(new Point(e.x,e.y+1),_.clone(t))}}}var numPaths=0;var gridSize=5;var Point=function(e,t){this.x=e;this.y=t};self.onmessage=function(e){importScripts("http://cdnjs.cloudflare.com/ajax/libs/underscore.js/1.7.0/underscore-min.js");var t=new Date;var n=e.data;if(n.gridSize){gridSize=n.gridSize}numPaths=0;move(new Point(0,0),[]);var r=new Date;var i=r-t;console.log("time duration in milliseconds: "+i);var s=getReadableDuration(i);self.postMessage({numPaths:numPaths,duration:s})}